(7, '[1, 2, 3, 4, 5, 6]', 'Gift Wraps', 'Wrap your gifts in style with our custom-printed gift wraps designed to make the packaging as special as the gift inside. Suited for personal gifting, boutiques, brands, or seasonal gifting, our gift wraps deliver vivid colours and text as well as premium paper quality.\n                Available in Silk and Uncoated paper types, yet provided with a single standard paper size and weight for consistent quality. Furthermore, a carbon offset option is also provided so you can highlight the style or occasion while being responsible. Turn your thoughtful gifts into an unforgettable memory with SpotPrint.', 1.50, 300, 1, '{\"tax\": {\"rate\": \"20\", \"type\": \"percentage\", \"enabled\": true}, \"formula\": \"Wraps\", \"paper_sizes\": {\"title\": \"Paper Size\", \"options\": [{\"title\": \"500 x 700mm\", \"value\": \"C2\"}]}, \"paper_types\": {\"title\": \"Paper Type\", \"options\": [{\"image\": \"SilkPaper.png\", \"title\": \"Silk\", \"value\": \"Silk\"}, {\"image\": \"UncoatedPaper.png\", \"title\": \"Uncoated\", \"value\": \"Uncoated\"}]}, \"carbon_offset\": {\"title\": \"Carbon Offset\", \"options\": [{\"title\": \"No\", \"value\": \"No\", \"price_increase\": 0}, {\"title\": \"Yes\", \"value\": \"Yes\", \"price_increase\": 3}], \"description\": \"3% extra charges for carbon offset of your order\"}, \"folding_types\": {\"title\": \"Folding Option\", \"options\": [{\"title\": \"FLAT\", \"value\": \"FLAT\", \"price_increase\": 0}, {\"title\": \"Folded to 250 x 175mm\", \"value\": \"Folded\", \"price_increase\": 10}]}, \"paper_weights\": {\"title\": \"Paper Weight\", \"options\": {\"Silk\": [{\"title\": \"115 gsm\", \"value\": \"115\"}], \"Uncoated\": [{\"title\": \"100 gsm\", \"value\": \"100\"}]}}, \"quantity_limits\": {\"max\": 25000, \"min\": 250}, \"printing_options\": {\"allowed_methods\": [\"Litho\"]}}', '{\"images\": [\"Giftwraps.png\", \"Giftwraps2.png\"], \"features\": [\"Folded and flat options available\", \"Vibrant an