(8, '[1, 2, 3, 4, 5, 6]', 'Letterheads', 'Perfect for invoices, legal documents, letters, or quotes, our letterheads are printed on premium paper stock that reflects your brands professionalism. Available in luxury uncoated paper type with standard paper size and weight. Choose between single or double-sided printing to best represent your business style. At SpotPrint, we help your documents look polished and reliable every time.', 5.00, 500, 1, '{\"tax\": {\"rate\": \"20\", \"type\": \"percentage\", \"enabled\": true}, \"formula\": \"Letterheads\", \"paper_sizes\": {\"title\": \"Paper Size\", \"options\": [{\"title\": \"A4\", \"value\": \"A4\"}]}, \"paper_types\": {\"title\": \"Paper Type\", \"options\": [{\"image\": \"UncoatedPaper.png\", \"title\": \"Luxury Uncoated\", \"value\": \"Uncoated\"}]}, \"carbon_offset\": {\"title\": \"Carbon Offset\", \"options\": [{\"title\": \"No\", \"value\": \"No\", \"price_increase\": 0}, {\"title\": \"Yes\", \"value\": \"Yes\", \"price_increase\": 3}], \"description\": \"3% extra charges for carbon offset of your order\"}, \"paper_weights\": {\"title\": \"Paper Weight\", \"options\": {\"Uncoated\": [{\"title\": \"120 gsm\", \"value\": \"120\"}]}}, \"printed_sides\": {\"title\": \"Printed Sides\", \"options\": [{\"title\": \"Single Side\", \"value\": \"Single Side\"}, {\"title\": \"Both Sides\", \"value\": \"Both Sides\"}]}, \"quantity_limits\": {\"max\": 25000, \"min\": 500}, \"printing_options\": {\"allowed_methods\": [\"Litho\", \"Digital\"]}}', '{\"images\": [\"Letterhead.jpg\"], \"features\": [\"Available in luxury uncoated paper\", \"Single or double-sided print\"]}', '2025-10-10 05:48:52', '2025-10-10 05:48:52', NULL),
(9, '[1, 2, 3, 4, 5, 6]', 'Business Cards', 'Make a strong and credible first impression with our exceptionally printed custom business cards. Designed to be a powerful extension of your brand, each card is produced in a standard size and weight for maximum impact. Additionally, our premium business cards are printed on high-quality silk paper for a sleek finish. With SpotPrints high-end business cards, impress your potential clients and build long-term connections.', 15.00, 200, 1, '{\"tax\": {\"rate\": \"20\", \"type\": \"percentage\", \"enabled\": true}, \"formula\": \"Cards\", \"paper_sizes\": {\"title\": \"Paper Size\", \"options\": [{\"title\": \"85 x 55mm\", \"value\": \"C25\"}]}, \"paper_types\": {\"title\": \"Paper Type\", \"options\": [{\"image\": \"SilkPaper.png\", \"title\": \"Silk\", \"value\": \"Silk\"}]}, \"paper_weights\": {\"title\": \"Paper Weight\", \"options\": {\"Silk\": [{\"title\": \"450 gsm\", \"value\": \"450\"}]}}, \"quantity_limits\": {\"max\": 10000, \"min\": 100}, \"printing_options\": {\"allowed_methods\": [\"Digital\"]}}', '{\"images\": [\"Business-Cards.png\"], \"features\": [\"Thick card stock\", \"Customizable design\"]}', '2025-10-10 05:48:52', '2025-10-10 05:48:52', NULL),
(10, '[1, 2, 3, 4, 5, 6]', 'Greetings Cards', 'At SpotPrint, we specialise in transforming your heartfelt messages into beautifully printed greeting cards accompanied by matching envelope options. Perfect for holidays, invitations, or thank-you notes, our cards are available in different finishes with flawless colour and detail. Choose from a wide variety of high-end paper options to best represent your style. Furthermore, add-ons like foiling and embossing are also available. To make the cards even more special, choose between different envelope options that perfectly complement the cards intention.', 1.50, 500, 1, '{\"tax\": {\"rate\": \"20\", \"type\": \"percentage\", \"enabled\": true}, \"formula\": \"Flyers\", \"flyer_types\": {\"title\": \"Card Type\", \"options\": [{\"title\": \"Folded\", \"value\": \"Folded\"}]}, \"paper_sizes\": {\"title\": \"Folded Size\", \"options\": [{\"title\": \"A5 (210 x 148mm)\", \"value\": \"A5\"}, {\"title\": \"A6 (148 x 105mm)\", \"value\": \"A6\"}]}, \"paper_types\": {\"title\": \"Paper\", \"options\": [{\"image\": \"SymbolPaper.png\", \"title\": \"Symbol\", \"value\": \"Symbol\", \"description\": \"Premium white coated paper with exceptional print quality\"}, {\"image\": \"DivaArtPaper.png\", \"title\": \"Diva Art Digital\", \"value\": \"DivaArt\", \"description\": \"Premium quality digital art paper with superior finish\"}, {\"image\": \"MonoStuccoPaper.png\", \"title\": \"Mono Stucco Tintoretto\", \"value\": \"MonoStucco\", \"description\": \"Elegant textured paper with a distinctive feel\"}, {\"image\": \"BramptonFeltPaper.png\", \"title\": \"Brampton Felt Marked\", \"value\": \"BramptonFelt\", \"description\": \"Classic felt-marked finish for a traditional look\"}, {\"image\": \"InfosetPaper.png\", \"title\": \"Infoset Uncoated\", \"value\": \"InfosetUncoated\", \"description\": \"Premium uncoated paper for a natural, sophisticated look\"}, {\"image\": \"EconomySilkPaper.png\", \"title\": \"Economy Silk\", \"value\": \"Econ