(11, '[1, 2, 3, 4, 5, 6]', 'Wedding Invitations', 'Make your special day even more memorable with our premium quality custom-printed wedding invitations. Create your perfect wedding card and choose from a wide variety of premium paper types, available in a flat size of A5 and A6. To add elegance to your wedding invite, enhancements like foiling and embossing are also available. At SpotPrint, we value your individual style; that\'s why we offer custom shape options as well as an array of envelope styles to best complement your aesthetic. ', 2.00, 500, 1, '{\"tax\": {\"rate\": \"20\", \"type\": \"percentage\", \"enabled\": true}, \"formula\": \"Flyers\", \"flyer_types\": {\"title\": \"Card Type\", \"options\": [{\"title\": \"FLAT\", \"value\": \"FLAT\"}]}, \"paper_sizes\": {\"title\": \"Flat Size\", \"options\": [{\"title\": \"A5 (210 x 148mm)\", \"value\": \"A5\"}, {\"title\": \"A6 (148 x 105mm)\", \"value\": \"A6\"}]}, \"paper_types\": {\"title\": \"Paper\", \"options\": [{\"image\": \"SymbolPaper.png\", \"title\": \"Symbol\", \"value\": \"Symbol\", \"description\": \"Premium white coated paper with exceptional print quality\"}, {\"image\": \"DivaArtPaper.png\", \"title\": \"Diva Art Digital\", \"value\": \"DivaArt\", \"description\": \"Premium quality digital art paper with superior finish\"}, {\"image\": \"MonoStuccoPaper.png\", \"title\": \"Mono Stucco Tintoretto\", \"value\": \"MonoStucco\", \"description\": \"Elegant textured paper with a distinctive feel\"}, {\"image\": \"BramptonFeltPaper.png\", \"title\": \"Brampton Felt Marked\", \"value\": \"BramptonFelt\", \"description\": \"Classic felt-marked finish for a traditional look\"}, {\"image\": \"InfosetPaper.png\", \"title\": \"Infoset Uncoated\", \"value\": \"InfosetUncoated\", \"description\": \"Premium uncoated paper for a natural, sophisticated look\"}, {\"image\": \"EconomySilkPaper.png\", \"title\": \"Economy Silk\", \"value\": \"EconomySilk\", \"description\": \"Cost-effective silk paper with good prin