(12, '[1, 2, 3, 4, 5, 6]', 'Roller Banners', '<p>Display your brand with our custom, high-end roller banners that come with sturdy hardware for convenient setup and transportation. Perfect for presentations, trade exhibitions, events, as well as retail displays. Our banners are printed on sustainable yet high-quality materials to enhance your businesss presence. Available in two different sizes, SpotPrints banners are designed to showcase your message with clarity, impact, and style.</p>', 45.00, 100, 1, '{\"tax\": {\"rate\": \"20\", \"type\": \"percentage\", \"enabled\": true}, \"formula\": \"FixedPrice\", \"paper_sizes\": {\"title\": \"Size\", \"options\": [{\"price\": 45, \"title\": \"Premium 800 x 2000mm\", \"value\": \"C4\", \"description\": \"Standard roller banner size\"}, {\"price\": 85, \"title\": \"1200 x 2000mm\", \"value\": \"C5\", \"description\": \"Large format roller banner\"}]}, \"quantity_limits\": {\"max\": 50, \"min\": 1}, \"printing_options\": {\"allowed_methods\": [\"Digital\"]}}', '{\"images\": [\"1761042576_441.jpg\", \"1761042576_431.jpg\"]}', '2025-10-10 05:48:52', '2025-10-21 10:29:37', NULL),
(13, '[6, 5, 4, 3, 2, 1]', 'Annual Reports', '<p>Our <strong>Online Annual Report Printing Service</strong> in the UK offers premium-quality printing solutions designed to showcase your companys achievements with professionalism and impact. Whether you need sleek corporate reports, detailed financial statements, or creative year-end summaries, we provide a seamless online ordering experience with customizable options for binding, paper type, and finishes. Using high-definition printing and durable materials, we ensure your reports look sharp, polished, and ready to impress investors, stakeholders, and clients. With fast nationwide delivery and competitive pricing, we make it effortless to print and present your annual reports with confidence.</p>', 4.50, 100, 0, '{\"formula\": \"Booklets\", \"orientation\": {\"title\": \"Paper Orientation\", \"options\": [{\"title\": \"Portrait\", \"value\": \"Portrait\"}, {\"title\": \"Landscape\", \"value\": \"Landscape\"}]}, \"printed_sides\": {\"title\": \"Printed Sides\", \"options\": []}, \"quantity_limits\": {\"max\": \"5000\", \"min\": \"50\", \"enabled\": true}, \"cover_special_options\": {\"foiling_required\": {\"title\": \"Foiling Required\", \"options\": [{\"title\": \"No\", \"value\": \"No\"}, {\"title\": \"Yes\", \"value\": \"Yes\"}], \"foil_colours\": {\"title\": \"\", \"options\": []}}, \"embossing_required\": {\"title\": \"Embossing Required\", \"options\": [{\"title\": \"No\", \"value\": \"No\"}, {\"title\": \"Yes\", \"value\": \"Yes\"}]}}}', '{\"images\": [\"1763194761_684.jpg\"]}', '2025-10-21 07:23:21', '2025-11-17 15:18:20', '2025-11-17 15:18:20'),
